import React, { Component } from 'react';

class Dice extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <i className={`fas fa-dice-${this.state.sum}`}></i>
        <i className={`fas fa-dice-${this.state.sum2}`}></i>
        <button>Roll Dice</button>
      </div>
    );
  }
}

export default Dice;
